import React from 'react';
import './fpage.css';
const HomePage = () => {
    return (
      <div className="middle_home">
          <div className="quote">
           
           <p ><img className="logo_body_img1" src="https://cdn.glitch.global/74966f89-6b4a-4631-ad79-95f11a65e0dd/logo11.jpg?v=1697535569992" alt="" />
           </p>
           <p className="p1">"Explore your own backyard before you venture abroad. "</p>
           <p>There's often beauty and wonder right in front of you.</p>
      
 </div>
          <div className="images_home1">
                <img className="img1" src="https://i.pinimg.com/564x/db/65/00/db6500d410d5ce49d1fa2bdb1e0fb59e.jpg" alt="" />
                <img className="img2" src="https://static.toiimg.com/img/64557054/Master.jpg" alt="" />
                <img className="img3" src="https://cdn.glitch.global/e03ff2e9-a998-4f89-bd9d-4f165ff29f7e/WhatsApp%20Image%202023-10-16%20at%2019.39.42_11b25124.jpg?v=1697465405646" alt="" />
                <img className="img4" src="https://i.pinimg.com/564x/db/24/15/db241518688a7b44afc81ab1ae2a452e.jpg" alt="" />
                <img className="img5" src="https://i.pinimg.com/564x/79/62/ab/7962ab14d826505d65b69734670f86e3.jpg" alt="" />
                <img className="img6" src="https://i.pinimg.com/564x/4d/ca/3b/4dca3b4395cfeebea7d00574b1344ddb.jpg" alt="" />
                <img className="img7" src="https://i.pinimg.com/564x/98/dc/6b/98dc6befc04a8d006e5381ba3e52bc4c.jpg" alt="" />
                <img className="img8" src="https://spaceflightnow.com/wp-content/uploads/2014/12/gslv-mkiii-x-13.jpg" alt="" />
                <img className="img9" src="https://scontent-maa2-2.xx.fbcdn.net/v/t1.6435-9/46482366_2349579225115307_6477206626813083648_n.jpg?_nc_cat=104&ccb=1-7&_nc_sid=7f8c78&_nc_ohc=UwBgCcWa0FUAX94RjXj&_nc_ht=scontent-maa2-2.xx&oh=00_AfAQMABAYgY2CaiSzWlh655U3zk33lwiElrzRjcFOBKvLw&oe=6554BE56" alt="" />
          </div>
        
          
        </div>
    );
}

export default HomePage;
